--基础数据组成分析
---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
--一、基础字典数据
-- 1.1　经济工作：病案费目、费用类型、结算场合、票据使用类别、人民币面额、收据费目、消费卡类型、医疗付款方式、中药输入快捷
-- 1.2 人员属性：病人类型、病人去向、地区、管理职务、国籍、婚姻状况、民族、区域、人员性质分类、社会关系、身份、性别、学历、血型、证件类型、职业、执业类别、专业技术职务
-- 1.3 药品管理：毁损发生原因、毁损解决办法、基本药物说明、药价管理级别、药品单据分类、药品毒理分类、药品货源情况、药品剂型、药品价值分类、药品来源分类、药品生产商、药品外观、药品用药梯次
-- 1.4 卫材管理：材料货源情况、材料生产商
-- 1.5 医疗工作：ICU类型、变异常见原因、病案类别、病理类型、病情、病生理情况、病原学目录、不良事件、部门环境类别、部门性质分类、常用剂量比例、常用体温说明、出院方式、床位编制分类、单病种目录、分化程度、分娩方式、感染部位、感染因素、号类、疾病报送单位、检验结果描述、抗菌用药评价项目、抗菌预防用药期间、临床病例分型、临床特征、临床性质、路径结果性质、路径常见结果、门诊诊室、器械导管目录、抢救病因分类、入院方式、入院属性、手术类型、手术切口愈合、输血目的、胎儿状况、细菌检测方法、医疗卡挂失方式、医疗类别、医学警示、医院感染目录、预约方式、造影剂、质控报告词句、质控检验方法、质控试剂来源、治疗结果、中药煎服脚注、住院目的、住院死亡原因、最高诊断依据
-- 1.6 医技工作：革兰染色分类、检验拒收理由、检验细菌菌属、检验细菌类别、影像打印格式、影像检查类别、影像胶片规格、诊疗检查类型、诊疗检验标本、诊疗检验类型、诊疗麻醉类型、诊疗手术规模
--二、应用支持数据
-- 2.1 系统参数数据：部门表、排队LED显示部件、医价接口、移动查房接口
-- 2.2 独立支持数据：家系称谓关系、期间表、时间段、特殊符号
-- 2.3 费用支持数据：费别、结算方式、结算方式应用、卡消费接口目录、收费记帐单、收费记帐单定义、收费项目类别、收入项目、费别明细、医疗卡类别
-- 2.4 药物支持数据：材料加成方案、单据环节控制、供应商、药品入出类别、药品单据性质、药品卫材精度
-- 2.5 诊疗支持数据：疾病编码类别、疾病参考项目、麻醉记录项目、医嘱内容定义、医嘱未执行原因、诊疗参考项目、诊疗检查部位、诊疗频率项目、诊疗频率时间、诊疗项目类别、诊治所见性质、诊治所见分类、诊治所见项目
-- 2.6 病历支持数据：病历常用样式、病历词句分类、病历词句示范、病历词句组成、病历页面格式、病历文件列表、病历文件结构、病历时限要求、病历书写事件、病历替代关系、疾病报告前提
-- 2.7 医保基础数据：保险类别、保险人群、保险中心目录、社区目录
-- 2.8 导诊基本数据：咨询图片元素、咨询附加选项、咨询段落目录、咨询页面目录
-- 2.9 护理支持数据：产程部件、护理记录项目、体温部件、体温部位、体温记录项目、体温重叠标记
-- 2.10 临床路径数据：临床路径图标、路径报表目录、路径报表结构、临床路径目录、临床路径版本、临床路径病种、临床路径分类、临床路径阶段、临床路径科室、临床路径评估、临床路径项目、临床路径文件、路径评估指标、路径评估条件
-- 2.11 影像支持数据：影像MWL结果集、影像标注存储表、影像查询方案、影像查询配置、影像界面参数表、影像鼠标按钮分配、影像图像信息表、影像颜色清单、影像预设窗宽窗位
-- 2.12 检验支持数据：病理档案分类、采血管类型、检验质控范则、检验质控规则、质控即刻法、质控控界系数
-- 2.13 零星数据：业务消息类型、ZLNOTICES
