--药品入出类别
Insert Into 药品入出类别(ID, 编码, 名称, 系数) 
Select 药品入出类别_ID.Nextval, Lpad(Rownum + B.RecordNum, 2, 0), 名称,1 From 药品单据分类 A, (Select Count(*) RecordNum From 药品入出类别) B Where 性质 = 1 Or 性质 = 4;
Insert Into 药品入出类别(ID, 编码, 名称, 系数) 
Select 药品入出类别_ID.Nextval, Lpad(Rownum + B.RecordNum, 2, 0),名称,-1 From 药品单据分类 A, (Select Count(*) RecordNum From 药品入出类别) B Where 性质 = 2 Or 性质 = 5;
Insert Into 药品入出类别(ID, 编码, 名称, 系数)
Select 药品入出类别_ID.Nextval, Lpad(Rownum + B.RecordNum, 2, 0), Substr(名称, 1, 4)||'入库', 1 From 药品单据分类 A, (Select Count(*) RecordNum From 药品入出类别) B Where 性质 = 3 And 编码 != 12 And 编码 != 37;
Insert Into 药品入出类别(ID, 编码, 名称, 系数)
Select 药品入出类别_ID.Nextval, Lpad(Rownum + B.RecordNum, 2, 0), Substr(名称, 1, 4)||'出库', -1 From 药品单据分类 A, (Select Count(*) RecordNum From 药品入出类别) B Where 性质 = 3 And 编码 != 12 And 编码 != 37;
Insert Into 药品入出类别(ID, 编码, 名称, 系数)
Select 药品入出类别_ID.Nextval, Lpad(Rownum + B.RecordNum, 2, 0), Substr(名称, 1, 4)||'盘赢', 1 From 药品单据分类 A, (Select Count(*) RecordNum From 药品入出类别) B Where 编码 = 12 Or 编码 = 37;
Insert Into 药品入出类别(ID, 编码, 名称, 系数)
Select 药品入出类别_ID.Nextval, Lpad(Rownum + B.RecordNum, 2, 0), Substr(名称, 1, 4)||'盘亏', -1 From 药品单据分类 A, (Select Count(*) RecordNum From 药品入出类别) B Where 编码 = 12 Or 编码 = 37;

