--路径报表结构
Insert Into 路径报表结构(报表ID,行号,项目序号,项目文本1,项目文本2,SQL文本,页数,路径ID,多选序号) 
Select 1,1,-Null,'一、效率指标',Null,Null,-Null,-Null,-Null From Dual Union All
Select 1,2,1,'平均住院日(天)',Null,'Select /*+ rule*/Trunc(Avg(b.住院天数),1) 平均住院天数,sum(b.住院天数) 总住院天数
From Table(f_Num2list2([1])) A, 病案主页 B
Where a.C1 = b.病人id And a.C2 = b.主页id',-Null,-Null,-Null From Dual Union All
Select 1,3,2,'手术病人术前平均住院日(天)',Null,'Select /*+ rule*/Trunc(Avg(b.开始执行时间 - c.入院日期),1) As 平均术前天数
From Table(f_Num2list2([1])) A, 病人医嘱记录 B, 病案主页 C
Where a.C1 = b.病人id And a.C2 = b.主页id And b.相关id Is Null And b.诊疗类别 = ''F'' And b.病人id = c.病人id And b.主页id = c.主页id',-Null,-Null,-Null From Dual Union All
Select 1,4,-Null,'二、效果指标',Null,Null,-Null,-Null,-Null From Dual Union All
Select 1,5,3,'病种死亡率(%)',Null,'Select /*+ rule*/
 Decode(Nvl(死亡率, 0), 0, ''  '', 死亡率 || ''%'') 死亡率, Decode(Nvl(治愈率, 0), 0, ''  '', 治愈率 || ''%'') 治愈率,
 Decode(Nvl(好转率, 0), 0, ''  '', 好转率 || ''%'') 好转率
From (Select Trunc(Sum(Decode(出院情况, ''死亡'', 1, 0)) / [2],2) * 100 As 死亡率, Trunc(Sum(Decode(出院情况, ''治愈'', 1, 0)) / [2],2) * 100 As 治愈率,
              Trunc(Sum(Decode(出院情况, ''好转'', 1, 0)) / [2],2) * 100 As 好转率
       From (Select Row_Number() Over(Partition By b.病人id, b.主页id Order By b.主页id Desc,b.记录来源 Desc) As Top, b.出院情况
              From Table(f_Num2list2([1])) A, 病人诊断记录 B
              Where a.C1 = b.病人id And a.C2 = b.主页id And b.诊断次序 = 1 And b.记录来源 In (3, 4) And b.诊断类型 In (13, 3) And
