From (Select Round(再住院14日 / [3], 2) * 100 再住院14日, Round(再住院31日 / [3], 2) * 100 再住院31日
       From (Select Sum(Decode(Sign(14 - 再次住院间隔), -1, 0, 1)) As 再住院14日, Sum(Decode(Sign(31 - 再次住院间隔), -1, 0, 1)) As 再住院31日
              From (Select c.病人id, Trunc(c.入院日期) - Trunc(d.出院日期) 再次住院间隔
                     From Table(f_Num2list([1])) A, 病人信息 B, 病案主页 C, 病案主页 D
                     Where a.Column_Value = b.病人id And b.病人id = c.病人id And b.住院次数 = c.主页id And b.住院次数 > 1 And b.病人id = d.病人id And
                           b.住院次数 - 1 = d.主页id
                     Union
                     Select /*当前在院的*/
                      c.病人id, Trunc(d.入院日期) - Trunc(c.出院日期) 再次住院间隔
                     From Table(f_Num2list2([2])) A, 病案主页 C, 病案主页 D
                     Where a.C1 = c.病人id And a.C2 = c.主页id And c.病人id = d.病人id And c.主页id + 1 = d.主页id)))',-Null,-Null,-Null From Dual Union All
