--影像查询方案
Insert Into 影像查询方案(ID,方案名称,方案说明,查询语句,是否默认,使用状态,方案序号,所属科室,是否启用规则,是否系统查询) 
Select 1,'按基本情况查询','根据病人基本信息进行查询。','select /* +rule*/ id
          from 病人医嘱记录 a, 病人信息 b,病人医嘱发送 c
          where a.病人id = b.病人id and a.id=c.医嘱ID  and a.诊疗类别=''D'' and c.执行部门Id=[当前科室ID]
                and b.姓名=[姓    名] and b.性别=[性    别] and b.住院号=[住 院 号] and b.门诊号=[门 诊 号] and b.就诊卡号=[就诊卡号] and b.健康号=[健 康 号] and  a.相关id is null
                and c.发送时间 between [开始日期] and [结束日期]',0,1,1,0,0,0 From Dual Union All
Select 2,'按临床诊断查询','根据临床诊断结果进行查询。','select /* +RULE*/ distinct a.id
          from 病人医嘱记录 a, 病人医嘱报告 b, 电子病历记录 c, 电子病历内容 d, 病人医嘱发送 e, 影像检查记录 f
          where a.id =b.医嘱id and a.id=e.医嘱Id and e.医嘱Id=f.医嘱Id and b.病历ID = c.ID and c.ID=d.文件ID
                and d.对象类型=4 And d.要素名称 =''临床诊断'' And d.内容文本=[临床诊断] and a.相关id is null
                and a.诊疗类别=''D'' and e.执行部门Id=[当前科室ID] and f.接收日期 between [开始日期] and [结束日期]',0,1,2,0,0,0 From Dual Union All
Select 3,'按诊断结果查询','根据诊断的相关结果进行检查查询。','select /* +RULE*/ a.id
          from 病人医嘱记录 a, 病人医嘱发送 b, 影像检查记录 c
          where a.id=b.医嘱id and b.医嘱id=c.医嘱id and a.相关id is null and a.诊疗类别=''D'' and b.执行部门Id=[当前科室ID]
                and c.危急状态=[left(cbxObj(3).text,1)] and c.报告质量=[left(cbxObj(5).text,1)] and c.影像质量=[left(cbxObj(6).text,1)] and b.结果阳性=[left(cbxObj(4).text,1)]
                and c.接收日期 between [开始日期] and [结束日期]',0,1,3,0,0,0 From Dual Union All
Select 4,'按检查情况查询','根据检查部位等信息进行查询。','select /* +rule*/ distinct 相关ID
          from 病人医嘱记录 a, 病人医嘱发送 b, 诊疗项目部位 c, 影像检查记录 d
          where a.id=b.医嘱id and a.诊疗项目ID=c.项目ID and b.医嘱Id=d.医嘱ID and a.诊疗类别=''D'' and b.执行部门Id=[当前科室ID]
                and c.类型=[类    别] and instr([检查部位],a.标本部位)>0
                and d.接收日期 between [开始日期] and [结束日期]',0,1,4,0,0,0 From Dual;
Select 影像查询方案_ID.Nextval From Dual Connect By Rownum <= (Select Nvl(Max(ID), 0) From 影像查询方案);

