Select 6,100,'SELECT C.名称 AS 药品
  FROM 药品储备限额 A,
       (select A.库房ID, A.药品ID, SUM(实际数量) AS 数量
	  from 药品库存 A
	 GROUP BY A.库房ID, A.药品ID) B,
       收费项目目录 C
 WHERE A.库房ID = B.库房id AND A.药品ID = B.药品ID AND A.药品ID = C.ID AND
       NVL(B.数量, 0) < NVL(A.下限, 0) AND
       A.库房ID IN (SELECT DISTINCT A.部门id
		      FROM 部门人员 A, 人员表 B
		     WHERE A.人员id = B.ID AND A.缺省 = 1 AND
			   UPPER(B.姓名) = UPPER([USER]))','[药品]等药品库存已低于下限了！',Null,107,1,'[药品];VARCHAR2',5,5,to_date('2014-10-13 11:09:57','yyyy-mm-dd hh24:mi:ss'),Null   From Dual Union All
